import React from "react";
import surgery from "/home/images/surgery.jpg";
const Contact = () => {
  return (
    <div className="about">
      <div className="abtell">
        Phone : +25471111112 <br></br>
        Customer support:<br></br>
        Email : support@doctorsapp.com<br></br>
        Official queries:<br></br>
        info@doctorsapp.com
      </div>
      <div className="abtimg">
        <img src={surgery} alt="surgery" />;
      </div>
    </div>
  );
};
export default Contact;
